import React from 'react'
import { GetMovie} from '../Reducers/MovieReducer';

import { useDispatch,useSelector } from 'react-redux'
export default function Read() {
    const dispatch=useDispatch();
    const movieData=useSelector((state)=>state.MovieData.movies);
  return (
    <div>
        <button onClick={()=>{dispatch(GetMovie())}}>Fetch data</button>
        <div>
            <ul>
            {movieData && movieData.map((ele) => (
            <li key={ele.id}>{ele.title}</li>
          ))}
            </ul>
        </div>
    </div>
  )
}
